import React, { useState, MouseEvent } from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import FitbitSharpIcon from '@mui/icons-material/FitbitSharp';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import { Container } from '@mui/material';

export default function Navbar() {
  const [anchorNav, setAnchorNav] = useState<null | HTMLElement>(null);

  const openMenu = (event:MouseEvent<HTMLElement>) => {
    setAnchorNav(event.currentTarget);
  };

  const closeMenu = () => {
    setAnchorNav(null);
  };

  return (
    <AppBar position='static'>
      <Container maxWidth='xl'>
        <Toolbar>
          <IconButton size='large' edge='start' color='inherit' aria-label='logo' sx={{ display: { xs: 'none', md: 'flex' } }}>
            <FitbitSharpIcon />
          </IconButton>
          <Typography variant='h6' component='div' sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
            Payakan
          </Typography>
          <Box sx={{ display: { xs: 'none', md: 'flex' } }}>
            <Button color='inherit'>Home</Button>
            <Button color='inherit'>About</Button>
            <Button color='inherit'>Product</Button>
            <Button color='inherit'>Contact</Button>
          </Box>
          <Box sx={{ display: { xs: 'flex', md: 'none' } }}>
            <IconButton size='large' edge='start' color='inherit' onClick={openMenu}>
              <MenuIcon />
            </IconButton>
            <Menu open={Boolean(anchorNav)} anchorEl={anchorNav} onClose={closeMenu}>
              <MenuItem onClick={closeMenu}>Home</MenuItem>
              <MenuItem onClick={closeMenu}>About</MenuItem>
              <MenuItem onClick={closeMenu}>Product</MenuItem>
              <MenuItem onClick={closeMenu}>Contact</MenuItem>
            </Menu>
          </Box>
          <IconButton size='large' edge='start' color='inherit' aria-label='logo' sx={{ display: { xs: 'flex', md: 'none' } }}>
            <FitbitSharpIcon />
          </IconButton>
          <Typography variant='h6' component='div' sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
            Payakan
          </Typography>
        </Toolbar>
      </Container>
    </AppBar>
  );
}
